mapper.select:

select 

from ONLINEQC.Y_AGPERSONTAB
where TENANTID = #{tenantid,jdbcType=VARCHAR}
  and DESTSYSID = #{destsysid,jdbcType=VARCHAR}
  and PERSONDBID = #{persondbid,jdbcType=VARCHAR}

mapper.delete:

delete from ONLINEQC.Y_AGPERSONTAB
where TENANTID = #{tenantid,jdbcType=VARCHAR}
  and DESTSYSID = #{destsysid,jdbcType=VARCHAR}
  and PERSONDBID = #{persondbid,jdbcType=VARCHAR}
